INSERT INTO `ierdb`.`Employees` (`name`, `title`, `email`, `bio`, `createdAt`, `updatedAt`) VALUES ('Erika Miller', 'CFO', 'ErikaM@gmail.com', 'Erika graduated from Harvard in 2000 with a B.S. in business and majoring in accounting. She began her career in the accounting department of Umbrella Corporation. After years of experience she was promoted to a Director role.', NULL, NULL);
INSERT INTO `ierdb`.`Employees` (`name`, `title`, `email`, `bio`, `createdAt`, `updatedAt`) VALUES ('Peter Chestnut', 'CEO', 'PChestnut@gmail.com', 'As CEO Peter is responsible for running all facets of the business. His experience as CEO and CFO of SwiftOlo and WhiteCloud respectively, lend him a proven executive track record. Peter also served as President of Globex Inc.\'s e-commerce division and was recognized by Internet World as one of the top 25 \'Click and Mortar\' executives in the country in June of 2000.', NULL, NULL);
INSERT INTO `ierdb`.`Employees` (`name`, `title`, `email`, `bio`, `createdAt`, `updatedAt`) VALUES ('Michael James', 'Director of Sales', 'MJames@gmail.com', 'After attending the University of Texas, Michael excelled in a sales role for Initech. He then ascended into a managerial role and increasing sales in his division drastically. In 2013 he was given the role of Director of Sales and was nominated for Forbes \'Top 25 Under 25\'.', NULL, NULL);
INSERT INTO `ierdb`.`Employees` (`name`, `title`, `email`, `bio`, `createdAt`, `updatedAt`) VALUES ('Alexandra Bennett', 'Marketing Director', 'AlexandraB@gmail.com', 'With over 20 years experience in international product sales, and applying a strong expertise in data-driven, long-term strategic planning, Alexandra excels in her role as Marketing director. Previous to this, Alexandra held various positions Director of International Sales & Marketing, Manager of Business Development, and Trade Sales Manager for St. Anky Beer.', NULL, NULL);
INSERT INTO `ierdb`.`Employees` (`name`, `title`, `email`, `bio`, `createdAt`, `updatedAt`) VALUES ('David Silver', 'Founder', 'silverfox@gmail.com', 'A native of New York, David graduated from Yale University with an honors degree in economic studies. David is a lifelong entrepreneur, adventurer, and tech aficionado. In 2014 he accepted the award for Most Innovative Startup, by the Inc. 500. David is focused on bringing quality products as well as streamlined experience to his customers. He is an avid traveler and aviation enthusiast, and has lived in Chile as well as Peru.', NULL, NULL);

COMMIT;

